import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar'

function App() {


  return (
    <div className="App">
      <Navbar />
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
    </div>
  );
}

export default App;
